export class Event {
    constructor(title, cal, startTime, endTime) {
        this.title = title;
        this.cal = cal;
        this.startTime = startTime;
        this.endTime = endTime;
    }

    duration = (endTime - startTime) / 60000;

    isAllDayEvent = duration == 1440;
}
